import Vue from 'vue'
import Router from 'vue-router'
import Home from '@/pages/Home/Home'
import UserPass from '@/pages/User/UserPass'
import UserFail from '@/pages/User/UserFail'
import ActPass from '@/pages/Activity/ActPass'
import ActWait from '@/pages/Activity/ActWait'
import ActFail from '@/pages/Activity/ActFail'
import Notify from '@/pages/Message/Notify'
import Feedback from '@/pages/Message/Feedback'
import Advertise from '@/pages/Advertise/Advertise'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: Home
    },
    {
      path: '/user/pass',
      name: 'UserPass',
      component: UserPass
    },
    {
      path: '/user/fail',
      name: 'UserFail',
      component: UserFail
    },
    {
      path: 'pass',
      name: 'ActPass',
      component: ActPass
    },
    {
      path: 'wait',
      name: 'ActWait',
      component: ActWait
    },
    {
      path: 'fail',
      name: 'ActFail',
      component: ActFail
    },
    {
      path: 'notify',
      name: 'Notify',
      component: Notify
    },
    {
      path: 'feedback',
      name: 'Feedback',
      component: Feedback
    },
    {
      path: '/advertise',
      name: 'Advertise',
      component: Advertise
    }
  ]
})
